import React from 'react';

function Introduction() {
  return (
    <div>
      <div className="container">
        <h1 className="text-center p-3">Self-Introduction</h1>
        <div className="row">
          <div className="col-sm-6">
              <h2>林湛</h2>
              <h4>前端工程師</h4>
              <p>1998年生於台南，從小居住於台北，個性活潑，程式方面有過開發react,vue的相關經驗，最後選擇react為主要框架，主要還是因為react有著更高的靈活性，且redux,hooks都有相關經驗</p>
          </div>
          <div className="col-sm-6">345</div>
        </div>
      </div>
    </div>
  );
}

export default Introduction;
